function App() {
  return (
    <>
    <BrowserRouter>
      <Switch>
        {/* Your Route components */}
        <Route path="/" exact component={Home} />
        <Route path="/register" component={Register} />
        {/* More routes */}
      </Switch>
    </BrowserRouter>
    </>
  );
}

export default App;
